analysisSets:
- order: 1
  condition:
    dataset: ADSL
    variable: ITTFL
    comparator: EQ
    value:
    - Y
  id: AnalysisSet_01_ITT
  label: Intent-to-Treat Population
- order: 1
  condition:
    dataset: ADSL
    variable: SAFFL
    comparator: EQ
    value:
    - Y
  id: AnalysisSet_02_SAF
  label: Safety Population
analysisGroupings:
- id: AnlsGrouping_01_Sex
  dataDriven: false
  label: Gender
  groupingVariable: SEX
  groups:
  - order: 1
    condition:
      dataset: ADSL
      variable: SEX
      comparator: EQ
      value:
      - M
    id: AnlsGrouping_01_Sex_1
    label: Male
  - order: 2
    condition:
      dataset: ADSL
      variable: SEX
      comparator: EQ
      value:
      - F
    id: AnlsGrouping_01_Sex_2
    label: Female
- id: AnlsGrouping_02_Trt
  dataDriven: false
  label: Treatment
  groupingVariable: TRT01A
  groups:
  - order: 1
    condition:
      dataset: ADSL
      variable: TRT01A
      comparator: EQ
      value:
      - Placebo
    id: AnlsGrouping_02_Trt_1
    label: Placebo
  - order: 2
    condition:
      dataset: ADSL
      variable: TRT01A
      comparator: EQ
      value:
      - Xanomeline Low Dose
    id: AnlsGrouping_02_Trt_2
    label: Xanomeline Low Dose
  - order: 3
    condition:
      dataset: ADSL
      variable: TRT01A
      comparator: EQ
      value:
      - Xanomeline High Dose
    id: AnlsGrouping_02_Trt_3
    label: Xanomeline High Dose
- id: AnlsGrouping_03_AgeGp
  dataDriven: false
  label: Age Group
  groupingVariable: AGEGR1
  groups:
  - order: 1
    condition:
      dataset: ADSL
      variable: AGEGR1
      comparator: EQ
      value:
      - <65
    id: AnlsGrouping_03_AgeGp_1
    label: < 65 years
  - order: 2
    condition:
      dataset: ADSL
      variable: AGEGR1
      comparator: IN
      value:
      - 65-80
      - '>80'
    id: AnlsGrouping_03_AgeGp_2
    label: â‰¥ 65 years
- id: AnlsGrouping_04_Race
  dataDriven: false
  label: Primary Race
  groupingVariable: RACE
  groups:
  - order: 1
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - AMERICAN INDIAN OR ALASKA NATIVE
    id: AnlsGrouping_04_Race_1
    label: American Indian or Alaska Native
  - order: 2
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - ASIAN
    id: AnlsGrouping_04_Race_2
    label: Asian
  - order: 3
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - BLACK OR AFRICAN AMERICAN
    id: AnlsGrouping_04_Race_3
    label: Black or African American
  - order: 4
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - NATIVE HAWAIIAN OR OTHER PACIFIC ISLANDER
    id: AnlsGrouping_04_Race_4
    label: Native Hawaiian or Other Pacific Islander
  - order: 5
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - WHITE
    id: AnlsGrouping_04_Race_5
    label: White
  - order: 6
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - MULTIPLE
    id: AnlsGrouping_04_Race_6
    label: Multiple
  - order: 7
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - NOT REPORTED
    id: AnlsGrouping_04_Race_7
    label: Not Reported
  - order: 8
    condition:
      dataset: ADSL
      variable: RACE
      comparator: EQ
      value:
      - UNKNOWN
    id: AnlsGrouping_04_Race_8
    label: Unknown
  - order: 9
