dataSubsets:
- level: 1
  order: 1
  condition:
    dataset: ADAE
    variable: TRTEMFL
    comparator: EQ
    value:
    - Y
  id: Dss01_TEAE
  label: Treatment-Emergent Adverse Events
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AEREL
        comparator: IN
        value:
        - POSSIBLE
        - PROBABLE
  id: Dss02_Related_TEAE
  label: Related Treatment-Emergent Adverse Events
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AESER
        comparator: EQ
        value:
        - Y
  id: Dss03_Serious_TEAE
  label: Serious Treatment-Emergent Adverse Events
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AEREL
        comparator: IN
        value:
        - POSSIBLE
        - PROBABLE
    - level: 2
      order: 3
      condition:
        dataset: ADAE
        variable: AESER
        comparator: EQ
        value:
        - Y
  id: Dss04_RelSer_TEAE
  label: Related Serious Treatment-Emergent Adverse Events
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AESDTH
        comparator: EQ
        value:
        - Y
  id: Dss05_TEAE_Ld2Dth
  label: Treatment-Emergent Adverse Events Leading to Death
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AESDTH
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 3
      compoundExpression:
        logicalOperator: OR
        whereClauses:
        - level: 3
          order: 1
          condition:
            dataset: ADAE
            variable: AEREL
            comparator: EQ
            value:
            - POSSIBLE
        - level: 3
          order: 2
          condition:
            dataset: ADAE
            variable: AEREL
            comparator: EQ
            value:
            - PROBABLE
  id: Dss06_Rel_TEAE_Ld2Dth
  label: Related Treatment-Emergent Adverse Events Leading to Death
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AEACN
        comparator: IN
        value:
        - DOSE REDUCED
        - DRUG INTERRUPTED
  id: Dss07_TEAE_Ld2DoseMod
  label: Treatment-Emergent Adverse Events Leading to Dose Modification
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADAE
        variable: TRTEMFL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADAE
        variable: AEACN
        comparator: EQ
        value:
        - DRUG WITHDRAWN
  id: Dss08_AE_Ld2TrtDsc
  label: Treatment-Emergent Adverse Events Leading to Treatment Discontinuation
- level: 1
  order: 1
  condition:
    dataset: ADVS
    variable: ANL01FL
    comparator: EQ
    value:
    - Y
  id: Dss09_VS_AnRec
  label: Vital Signs Analysis Records
- level: 1
  order: 1
  compoundExpression:
    logicalOperator: AND
    whereClauses:
    - level: 2
      order: 1
      condition:
        dataset: ADVS
        variable: ANL01FL
        comparator: EQ
        value:
        - Y
    - level: 2
      order: 2
      condition:
        dataset: ADVS
        variable: AVISIT
        comparator: NE
        value:
        - Baseline
  id: Dss10_VS_NonBl_AnRec
  label: Vital Signs Non-baseline Analysis Records
